Switching from an open chuck sleeve to a closed chuck sleeve on the Doosan PUMA 2600SY... 

Open chuck sleeves are used when making parts from bar stock and closed chuck sleeves are preferred when machining single pieces of stock... to prevent chip buildup in the drawtube.

